const t={about1:{t:0,b:{t:2,i:[{t:3}],s:"Компанія “ТБК-1” була заснована в 2006р."}},about2:{t:0,b:{t:2,i:[{t:3}],s:"Виконуємо роботи будь-якої складності, пов’язані з металоконструкціями для об’єктів житлового будівництва, приватного сектору, котеджних містечок, бізнесу та виробничих підприємств."}},about3:{t:0,b:{t:2,i:[{t:3}],s:"Проектуєм, виготовляєм, привозим, монтуєм."}},about4:{t:0,b:{t:2,i:[{t:3}],s:"Співпрацюєм з будівельними копаніями, підрядними організаціями та кінцевим споживачем."}},facades_desc:{t:0,b:{t:2,i:[{t:3}],s:"Сучасні фасади, вдосконалюють естетичний вигляд і функціональність будь-якої будівлі. Наші фахівці забезпечують точне проектування, виготовлення та монтаж фасадів, використовуючи високоякісні матеріали та передові технології. Скляні фасади гарантують максимальне природне освітлення та створюють затишне середовище всередині приміщень, а вентильовані фасади забезпечують ефективну термо- та звукоізоляцію, а також довговічний захист від зовнішніх впливів. Звертайтесь до нас для створення надійних та привабливих фасадів, які відповідають вашим найвищим вимогам."}},navesi_desc:{t:0,b:{t:2,i:[{t:3}],s:"Автомобільні навіси забезпечують надійний захист від атмосферних впливів і ультрафіолетового випромінювання, зберігаючи ваш транспортний засіб у належному стані незалежно від погодних умов. Звертайтеся до нас для виготовлення та встановлення автомобільних навісів, які відзначаються довговічністю, естетичним виглядом та функціональністю."}},parkani_desk:{t:0,b:{t:2,i:[{t:3}],s:"Наші спеціалісти проектують і встановлюють паркани різних видів, які забезпечують надійний захист вашого майна. Використовуємо тільки високоякісні матеріали, що гарантує довговічність і естетичність огорож. Звертайтесь до нас для отримання надійного рішення, яке відповідатиме вашим потребам і вподобанням."}},shodi_desc:{t:0,b:{t:2,i:[{t:3}],s:"Ми надаємо професійні послуги зі створення сходів для будь-яких приміщень. Наші фахівці ретельно розробляють проєкт, враховуючи всі вимоги замовника та особливості інтер'єру. Використовуємо якісні матеріали та новітні технології, щоб забезпечити довговічність, надійність та естетичний вигляд сходів. Звертайтесь до нас для створення стильних та функціональних сходів, що стануть прикрасою вашого будинку чи офісу."}},vorota_desc:{t:0,b:{t:2,i:[{t:3}],s:"Наші фахівці проектують і встановлюють розсувні ворота, що поєднують сучасний дизайн і високу функціональність. Використовуємо тільки якісні матеріали, що забезпечує надійну роботу воріт протягом тривалого часу. Розсувні ворота – це ідеальне рішення для оптимізації простору та забезпечення зручного доступу до вашої території. Звертайтесь до нас для отримання індивідуального рішення, яке відповідатиме вашим потребам."}},dveri_desc:{t:0,b:{t:2,i:[{t:3}],s:"Ми пропонуємо послуги зі створення вхідних дверей та хвірток для вашої безпеки і комфорту. Наші фахівці розробляють та встановлюють вхідні двері й хвіртки, що поєднують естетику, міцність і надійність. Використовуємо лише високоякісні матеріали, які забезпечують довговічність і захист вашого будинку або території. Зверніться до нас для створення індивідуального рішення, що відповідатиме всім вашим потребам і вподобанням."}}};export{t as default};
